const _EMOJI = {
  happy:
    "data:image/png;base64,",
  cry:
    "data:image/png;base64,",
  want:
    "data:image/png;base64,",
  unexpect:
    "data:image/png;base64,",
  laugh:
    "data:image/png;base64,",
  shock:
    "data:image/png;base64,",
  sleepy:
    "data:image/png;base64,",
  dead:
    "data:image/png;base64,",
  suprise:
    "data:image/png;base64,"
};

export const emojiImg = (player) => {
  if (player.total <= -750) {
    return _EMOJI.dead;
  }

  if (player.total <= -500) {
    return _EMOJI.shock;
  }

  if (player.total <= -250) {
    return _EMOJI.cry;
  }

  if (player.total <= -100) {
    return _EMOJI.unexpect;
  }

  if (player.total <= 100) {
    return _EMOJI.sleepy;
  }

  if (player.total <= 250) {
    return _EMOJI.happy;
  }

  if (player.total <= 500) {
    return _EMOJI.laugh;
  }

  if (player.total <= 750) {
    return _EMOJI.suprise;
  }

  return _EMOJI.shock;
};
